var cookieHandle={getCookie:function(j){var h=document.cookie.split("; "),f;for(var i=0,g=h.length;i<g;i++){f=h[i].split("=");if(f[0]==encodeURIComponent(j)){return decodeURIComponent(f[1])}}return""},setCookie:function(f){var d=encodeURIComponent(f.name)+"="+encodeURIComponent(f.value);if(f.expiresHours){var e=new Date();e.setTime(e.getTime()+f.expiresHours*3600*1000);d=d+"; expires="+e.toUTCString()}if(f.path){d=d+"; path="+f.path}if(f.domain){d=d+"; domain="+f.domain}document.cookie=d},deleteCookie:function(d,f){var e=new Date(0);document.cookie=d+"=88; expires="+e.toUTCString()+(f.path?("; path="+f.path):"")+(f.domain?("; domain="+f.domain):"")}};